import React from 'react'

const Signup = () => {
    return (
        <div className="Login">
            <div className="Login-text">
                <h1>Sign Up to</h1>
                <h2>Our Website</h2>
                <p>If you already have an account.<br/>Login in</p>
            </div>
            
        </div>
    )
}

export default Signup
